import React, {useEffect} from 'react';
import AddWords from "./AddWords/AddWords";
import ShowWords from "./ShowWords/ShowWords";
import styles from "./WordsPage.module.css"
import {useParams} from "react-router";
import {useDispatch, useSelector} from "react-redux";
import {loadNoteById} from "../../../../../redux/actions/actionCreator";

const WordsPage = () => {
    const {id} = useParams()
    const words = useSelector(state => state.WordsReducer)
    const dispatch = useDispatch()

    useEffect(()=>{
        dispatch(loadNoteById({id}))
    },[dispatch])
    return (
        <div className={styles.wrapper}>
            <AddWords/>
            <ShowWords/>
        </div>
    );
};

export default WordsPage;
